import React from 'react';
import $ from "jquery";
import Axios from "axios";

const submitForm = (e) => {
    e.preventDefault()
    if ($('#email')[0].value === "" || $('#pass')[0].value === "") {
        console.log('Invalid')
        return
    }
    Axios.post('http://127.0.0.1:4567/login', {
        email: $("#email")[0].value,
        pass: $("#pass")[0].value
    }).then((res) => {
        console.log(res)
    })
}

const Registration = () => {
    return (
        <div className='container m-5'>
            <form>
                <div className='mb-3'>
                    <label htmlFor="exampleInputEmail1" className="form-label">Registration Number</label>
                    <input type="text" className="form-control" id="reg"/>
                </div>
                <button type="submit" className="btn btn-primary" onClick={e => submitForm(e)}>Submit</button>
            </form>

        </div>
    );
};

export default Registration;
